var inSeconds; 
$(function() {
        var cd = $('#countdown');
        var a = (cd.text()).split(':');
        inSeconds = a[0]*60 + a[1]*1;
        var interv = setInterval(function() {
            inSeconds --;
            var minute = Math.floor((inSeconds) / 60);
            var seconds = inSeconds - (minute * 60);
            if(seconds < 10){
                seconds = '0'+seconds;
            }
            var c = minute + ':' + seconds;
            cd.html(c);
            if (inSeconds == 0) {
                //window.location.reload(false);
                clearInterval(interv);
            }
        }, 1000);
    });

